import React from "react";

export default function Card(props) {
  const { event } = props;
  return (
    <article className="cocktail">
      <figure className="img-container">
        <img src={event.image} alt={event.name} />
      </figure>
      <h4 className="bolder">{event.name}</h4>
      <span>
        <b>Date:</b>
        {event.date}
      </span>
      <span>
        <b>Time:</b>
        {event.time}
      </span>
    </article>
  );
}
